import React from "react";
import { NavLink } from "react-router-dom";
import classes from './Dialogs.module.css';

const DialogsItem = (props) => {
    return (
        <div className={classes.dialog + ' ' + classes.active}>
            <NavLink to={'/dialogs/' + props.id}>{props.name}</NavLink>
        </div>

    )
}

const Dialogs = (props) => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                < DialogsItem name='Aleksey' id='1' />
                < DialogsItem name='Dmitiy' id='2' />
                < DialogsItem name='Grigorii' id='3' />
                < DialogsItem name='Eugeny' id='4' />
                < DialogsItem name='Artem' id='5' />
            </div>
            <div className={classes.messages}>
                <div className={classes.dialog}>Hi</div>
                <div className={classes.dialog}>how is your work</div>
                <div className={classes.dialog}>you are good</div>

            </div>
        </div>
    )
}
export default Dialogs
